  | "user"
  | "browser"
  | "runtime"
  | "os"
  | "client_os"
  | "device"
  | "gpu";

interface Errors {
  data: { [key: string]: string };
  message: string;
  type: string;
}

export type EntryType =
  | "exception"
  | "breadcrumbs"
  | "request"
  | "message"
  | "csp";

export interface Entry<Type extends EntryType, Data extends {}> {
  data: Data;
  type: Type;
}

