        return EMPTY;
      })
    );
  }

  authenticateTOTP(code: string) {
    const url = "/api/mfa/authenticate/totp/";
    const data = {
      otp: code,
    };
    this.setState({ loading: true, error: null });
    return this.http.post(url, data).pipe(
      tap(() => {
        this.clearState();
        this.authService.afterLogin();
      }),
      catchError((err) => {
        let error: ServerError | null = null;
        if (err.status === 400) {
          error = { non_field_errors: err.error };
        } else {
          error = { non_field_errors: ["Error"] };
        }
        this.setState({ loading: false, error });
        return EMPTY;
      })
    );
  }

  authenticateBackupCode(code: string) {
    const url = "/api/mfa/authenticate/backup_codes/";
    const data = {
      code: code,
    };
    this.setState({ loading: true, error: null });
    return this.http.post(url, data).pipe(
      tap(() => {
        this.clearState();
        this.authService.afterLogin();
      }),
      catchError((err) => {
        let error: ServerError | null = null;
        if (err.status === 400) {
          if (err.error.code) {
            error = err.error;
            console.log(error);
          } else {
            error = { non_field_errors: err.error };
          }
        } else {
          error = { non_field_errors: ["Error"] };
        }
        this.setState({ loading: false, error });
        return EMPTY;
      })
    );
  }
}

import { Injectable } from "@angular/core";
import { Router } from "@angular/router";
import { BehaviorSubject, fromEvent } from "rxjs";
import { debounceTime, map, tap } from "rxjs/operators";

interface MainNavState {
  navOpen: boolean;
  mobileNav: boolean | null;
}

const initialState: MainNavState = {
  navOpen: true,
  mobileNav: null,
};

@Injectable({
  providedIn: "root",
})
export class MainNavService {
  private readonly state = new BehaviorSubject<MainNavState>(initialState);
  private readonly getState$ = this.state.asObservable();

  readonly navOpen$ = this.getState$.pipe(map((state) => state.navOpen));
  readonly mobileNav$ = this.getState$.pipe(map((state) => state.mobileNav));

  constructor(private router: Router) {
    const tabletSize = 768; // same as $tablet for scss

    if (window.innerWidth < tabletSize) {
      this.mobileNavSettings();
    } else {
      this.desktopNavSettings();
    }

    this.router.events.subscribe((_) => {
      if (window.innerWidth < tabletSize) {
        this.setCloseNav();
      }
    });

    fromEvent(window, "resize")
      .pipe(
        debounceTime(100),
        tap((_) => {
          if (window.innerWidth < tabletSize) {
            this.mobileNavSettings();
          } else {
            this.desktopNavSettings();
          }
        })
      )
      .subscribe();
  }

  mobileNavSettings() {
    this.setMobileNav(true);
    this.setCloseNav();
  }

  desktopNavSettings() {
    this.setMobileNav(false);
    this.setOpenNav();
  }

  getToggleNav() {
    this.setToggleNav();
  }

  getClosedNav() {
    this.setCloseNav();
  }

  private setMobileNav(isMobile: boolean) {
    this.state.next({
      ...this.state.getValue(),
      mobileNav: isMobile,
    });
  }

  private setCloseNav() {
    this.state.next({
      ...this.state.getValue(),
      navOpen: false,
    });
  }

  private setOpenNav() {
    this.state.next({
      ...this.state.getValue(),
      navOpen: true,
    });
  }

  private setToggleNav() {
    const navOpen = this.state.getValue().navOpen;
    this.state.next({
      ...this.state.getValue(),
      navOpen: !navOpen,
    });
  }
}

