import { baseUrl } from "../../constants";
import { APIToken, NewAPIToken } from "./api-tokens.interfaces";
import { APIBaseService } from "../api-base.service";

@Injectable({
  providedIn: "root",
})
export class APITokenService extends APIBaseService {
  readonly url = baseUrl + "/api-tokens/";
  constructor(protected http: HttpClient) {
    super(http);
  }

  list() {
    return this.http.get<APIToken[]>(this.url);
  }

  retrieve(id: string) {
    return this.http.get<APIToken>(this.detailURL(id));
  }

  create(newToken: NewAPIToken) {
    return this.http.post<APIToken>(this.url, newToken);
  }

  destroy(id: string) {
    return this.http.delete(this.detailURL(id));
  }
}

import { Injectable } from "@angular/core";
import { HttpClient } from "@angular/common/http";
import { Router } from "@angular/router";
import { map, tap } from "rxjs/operators";
import { StatefulService } from "src/app/shared/stateful-service/stateful-service";

export interface AuthState {
  isLoggedIn: boolean;
  redirectUrl: string;
}

const initialState: AuthState = {
  isLoggedIn: false,
  redirectUrl: "",
};

@Injectable({
  providedIn: "root",
})
export class AuthService extends StatefulService<AuthState> {
  isLoggedIn = this.getState$.pipe(map((data) => data.isLoggedIn));
  private readonly url = "/rest-auth/logout/";

  constructor(private http: HttpClient, private router: Router) {
    super(initialState);
    const authData = localStorage.getItem("auth");
    if (authData) {
      const auth = JSON.parse(authData);
      this.setState({
        isLoggedIn: auth.isLoggedIn,
        redirectUrl: auth.redirectUrl,
      });
    }
  }

  setAuth(data: AuthState) {
    this.state.next(data);
    localStorage.setItem("auth", JSON.stringify(data));
  }

  setRedirectUrl(url: string) {
    this.setAuth({
      isLoggedIn: false,
      redirectUrl: url,
    });
  }

  afterLogin(redirect = true) {
    const redirectUrl = this.state.getValue().redirectUrl;
    this.setAuth({ isLoggedIn: true, redirectUrl: "" });
    if (redirect) {
      this.router.navigateByUrl(redirectUrl);
    }
  }

  /** Log out user from the backend  */
  logout() {
    this.http
      .post(this.url, null)
      .pipe(
        tap(() => this.removeAuth()),
        tap(() => {
          // tslint:disable:no-any
          const _paq = (window as any)._paq;
          _paq.push(["resetUserId"]);
        })
      )
      .toPromise();
  }

  passwordReset(email: string) {
    const data = { email };
    const url = "/rest-auth/password/reset/";
    return this.http.post(url, data);
  }

  /** Explicitly log out */
  removeAuth() {
    this.clearAuth();
    window.location.href = "/login";
  }

  /** Run if server thinks user is logged out. */
  expireAuth() {
    this.clearAuth();
    this.setRedirectUrl(window.location.pathname);
    window.location.href = "/login";
  }

  private clearAuth() {
    this.clearState();
    localStorage.clear();
  }
}

import { Injectable } from "@angular/core";
import { Router } from "@angular/router";
import { BehaviorSubject, EMPTY } from "rxjs";
import { tap, map, catchError } from "rxjs/operators";
import { APIToken } from "src/app/api/api-tokens/api-tokens.interfaces";
import { APITokenService } from "src/app/api/api-tokens/api-tokens.service";

interface AuthTokensState {
  apiTokens: APIToken[];
  loading: {
    apiTokens: boolean;
    create: boolean;
    delete: string | null;
  };
  createError: string;
  createErrorLabel: string;
  createErrorScopes: string;
}

const initialState: AuthTokensState = {
  apiTokens: [],
  loading: {
    apiTokens: false,
    create: false,
    delete: null,
  },
  createError: "",
  createErrorLabel: "",
  createErrorScopes: "",
};

@Injectable({
  providedIn: "root",
})
export class AuthTokensService {
  private readonly state = new BehaviorSubject<AuthTokensState>(initialState);
  private readonly getState$ = this.state.asObservable();
  readonly apiTokens$ = this.getState$.pipe(map((state) => state.apiTokens));
  readonly initialLoad$ = this.getState$.pipe(
    map((state) => state.loading.apiTokens)
  );
  readonly createError$ = this.getState$.pipe(
    map((state) => state.createError)
  );
  readonly createErrorLabel$ = this.getState$.pipe(
    map((state) => state.createErrorLabel)
  );
  readonly createErrorScopes$ = this.getState$.pipe(
    map((state) => state.createErrorScopes)
  );
  readonly createLoading$ = this.getState$.pipe(
    map((state) => state.loading.create)
  );
  readonly deleteLoading$ = this.getState$.pipe(
    map((state) => state.loading.delete)
  );

  constructor(
    private apiTokenService: APITokenService,
    private router: Router
  ) {}

  loadAuthTokens() {
    this.apiTokenService
      .list()
      .pipe(
        tap((apiTokens) => {
          this.setAPITokensLoading();
          this.setAPITokens(apiTokens);
        })
      )
      .toPromise();
  }

  createAuthToken(label: string, scopes: string[]) {
    this.setCreateLoading(true);
    this.apiTokenService
      .create({ label, scopes })
      // TODO handle errors
      .pipe(
        tap(() => {
          this.setCreateLoading(false);
          this.router.navigate(["/profile/auth-tokens"]);
        }),
        catchError((error) => {
          this.setCreateLoading(false);
          if (error) {
            if (error.status === 400) {
              if (error.error.label) {
                error.error.label.length === 1
                  ? this.setCreateLabelError(error.error.label[0])
                  : this.setCreateLabelError(error.error.label.join(" "));
              }
              if (error.error.scopes) {
                error.error.scopes.length === 1
                  ? this.setCreateScopesError(error.error.scopes[0])
                  : this.setCreateScopesError(error.error.scopes.join(" "));
              }
            } else {
              this.setCreateError(`${error.statusText}: ${error.status}`);
            }
          }
          return EMPTY;
        })
      )
      .toPromise();
  }

  deleteAuthToken(id: string) {
    this.setDeleteLoading(id);
    this.apiTokenService
      .destroy(id)
      .pipe(
        tap(() => {
          this.loadAuthTokens();
        })
      )
      .toPromise();
  }

  clear() {
    this.state.next(initialState);
  }

  resetCreateErrors() {
    const state = this.state.getValue();
    this.state.next({
      ...state,
      createError: "",
      createErrorLabel: "",
      createErrorScopes: "",
    });
  }

  private setAPITokens(apiTokens: APIToken[]) {
    const state = this.state.getValue();
    this.state.next({
      ...state,
      apiTokens,
    });
  }

  private setAPITokensLoading() {
    const state = this.state.getValue();
    this.state.next({
      ...state,
      loading: { ...state.loading, apiTokens: true },
    });
  }

  private setDeleteLoading(id: string) {
    const state = this.state.getValue();
    this.state.next({
      ...state,
      loading: { ...state.loading, delete: id },
    });
