import { Injectable } from "@angular/core";
import { HttpErrorResponse } from "@angular/common/http";
import { MatSnackBar } from "@angular/material/snack-bar";
import { combineLatest, Observable, EMPTY } from "rxjs";
import { tap, catchError, map, take } from "rxjs/operators";
import { Issue, IssueWithSelected, IssueStatus } from "./interfaces";
import { IssuesAPIService } from "../api/issues/issues-api.service";
import {
  initialPaginationState,
  PaginationStatefulService,
  PaginationStatefulServiceState,
} from "../shared/stateful-service/pagination-stateful-service";
import { Environment } from "../api/organizations/organizations.interface";
import { OrganizationAPIService } from "../api/organizations/organizations-api.service";

export interface IssuesState extends PaginationStatefulServiceState {
  issues: Issue[];
  selectedIssues: number[];
  organizationEnvironments: Environment[];
  selectedProjectInfo: { orgSlug?: string; projectId?: string; query?: string };
  areIssuesForProjectSelected: boolean;
  errors: string[];
}

const initialState: IssuesState = {
  issues: [],
  selectedIssues: [],
  pagination: initialPaginationState,
  organizationEnvironments: [],
  selectedProjectInfo: {},
  areIssuesForProjectSelected: false,
  errors: [],
};

@Injectable({
  providedIn: "root",
})
export class IssuesService extends PaginationStatefulService<IssuesState> {
  issues$ = this.getState$.pipe(map((state) => state.issues));
  selectedIssues$ = this.getState$.pipe(map((state) => state.selectedIssues));
  issuesWithSelected$: Observable<IssueWithSelected[]> = combineLatest([
    this.issues$,
    this.selectedIssues$,
  ]).pipe(
    map(([issues, selectedIssues]) =>
      issues.map((issue) => ({
        ...issue,
        isSelected: selectedIssues.includes(issue.id) ? true : false,
        projectSlug: issue.project?.slug,
      }))
    )
  );
  areAllSelected$ = combineLatest([this.issues$, this.selectedIssues$]).pipe(
    map(
      ([issues, selectedIssues]) =>
        issues.length === selectedIssues.length && issues.length > 0
    )
  );
  readonly searchHits$ = this.getState$.pipe(
    map((state) => state.pagination.hits)
  );
  readonly thereAreSelectedIssues$ = this.selectedIssues$.pipe(
    map((selectedIssues) => selectedIssues.length > 0)
  );
  readonly organizationEnvironments$ = this.getState$.pipe(
    map((data) => data.organizationEnvironments)
  );
  readonly numberOfSelectedIssues$ = this.getState$.pipe(
    map((state) => state.selectedIssues.length)
  );
  readonly selectedProjectInfo$ = this.getState$.pipe(
    map((state) => state.selectedProjectInfo)
  );
  readonly errors$ = this.getState$.pipe(map((state) => state.errors));
  /**
   * Uses reducer to remove duplicate environments, also converts objects to a
   * list of names since that's all that the component requires
   */
  readonly organizationEnvironmentsProcessed$ = this.organizationEnvironments$.pipe(
    map((environments) =>
      environments.reduce(
        (accumulator, environment) => [
          ...accumulator,
          ...(!accumulator.includes(environment.name)
            ? [environment.name]
            : []),
        ],
        [] as string[]
      )
    )
  );

  constructor(
    private snackbar: MatSnackBar,
    private issuesAPIService: IssuesAPIService,
    private organizationsAPIService: OrganizationAPIService
  ) {
    super(initialState);
  }

  /** Refresh issues data. orgSlug is required. */
  getIssues(
    orgSlug: string,
    cursor: string | undefined,
    query: string = "is:unresolved",
    project: string[] | null,
    start: string | undefined,
    end: string | undefined,
    sort: string | undefined,
    environment: string | undefined
  ) {
    this.retrieveIssues(
      orgSlug,
      cursor,
      query,
      project,
      start,
      end,
      sort,
      environment
    ).toPromise();
  }

  getOrganizationEnvironments(orgSlug: string) {
    return this.retrieveOrganizationEnvironments(orgSlug);
  }

  toggleSelected(issueId: number) {
    const state = this.state.getValue();
    let selectedIssues: number[];
    if (state.selectedIssues.includes(issueId)) {
      selectedIssues = state.selectedIssues.filter(
        (issue) => issue !== issueId
      );
    } else {
      selectedIssues = state.selectedIssues.concat([issueId]);
    }
    this.state.next({ ...state, selectedIssues });
  }

  toggleSelectAll() {
    const state = this.state.getValue();
    if (state.issues.length === state.selectedIssues.length) {
      this.state.next({
        ...state,
        selectedIssues: [],
      });
      this.clearBulkProjectUpdate();
    } else {
      this.state.next({
        ...state,
        selectedIssues: state.issues.map((issue) => issue.id),
      });
    }
  }

  /** Set one specified issue ID as status */
  setStatus(id: number, status: IssueStatus) {
    return this.updateStatus(status, [id]);
  }

  /** Set all selected issues to this status */
  bulkSetStatus(status: IssueStatus) {
    combineLatest([this.selectedIssues$, this.selectedProjectInfo$])
      .pipe(
        take(1),
        map(([selectedIssues, selectedProjectInfo]) => {
          return this.updateStatus(
            status,
            selectedIssues,
            selectedProjectInfo.orgSlug,
            selectedProjectInfo.projectId,
            selectedProjectInfo.query
          ).toPromise();
        })
      )
      .subscribe();
  }

  bulkUpdateIssuesForProject(
    orgSlug: string,
    projectId: string,
    query: string
  ) {
    this.setBulkUpdateIssuesForProject(orgSlug, projectId, query);
  }

  clearProjectInfo() {
    this.clearBulkProjectUpdate();
  }

  /** Get issues from backend using appropriate endpoint based on organization */
  private retrieveIssues(
    organizationSlug?: string,
    cursor?: string,
    query?: string,
    project?: string[] | null,
    start?: string,
    end?: string,
    sort?: string,
    environment?: string
  ) {
    this.setClearErrors();
    return this.issuesAPIService
      .list(
        organizationSlug,
        cursor,
        query,
        project,
        start,
        end,
        sort,
        environment
      )
      .pipe(
        tap((res) => {
          this.setStateAndPagination({ issues: res.body! }, res);
        }),
        catchError((err: HttpErrorResponse) => {
          this.setIssuesError(err);
          return EMPTY;
        })
      );
  }

  private updateStatus(
    status: IssueStatus,
    ids: number[],
    orgSlug?: string,
    projectId?: string,
    query?: string
  ) {
    return this.issuesAPIService
      .update(status, ids, orgSlug, projectId, query)
      .pipe(
        tap((resp) => {
          this.setIssueStatuses(ids, resp.status);
          this.clearBulkProjectUpdate();
        }),
        catchError((err: HttpErrorResponse) => {
          this.snackbar.open("Error, unable to update issue");
          return EMPTY;
        })
      );
  }

  private clearBulkProjectUpdate() {
    const state = this.state.getValue();
    this.state.next({
      ...state,
      selectedProjectInfo: {},
    });
  }

  private setBulkUpdateIssuesForProject(
    orgSlug?: string,
    projectId?: string,
    query?: string
  ) {
    const state = this.state.getValue();
    this.state.next({
      ...state,
      selectedProjectInfo: { orgSlug, projectId, query },
    });
  }

  private setClearErrors() {
    const state = this.state.getValue();
    this.setState({
      errors: [],
      pagination: { ...state.pagination, loading: false },
    });
  }

  private setIssueStatuses(issueIds: number[], status: IssueStatus) {
    const state = this.state.getValue();
    this.state.next({
      ...state,
      issues: state.issues.map((issue) =>
        issueIds.includes(issue.id) ? { ...issue, status } : issue
      ),
      selectedIssues: [],
    });
  }

  private setIssuesError(errors: HttpErrorResponse) {
    const state = this.state.getValue();
    this.setState({
      errors: this.updateErrorMessage(errors),
      pagination: {
        ...state.pagination,
        loading: false,
        initialLoadComplete: true,
      },
    });
  }

  private retrieveOrganizationEnvironments(orgSlug: string) {
    return this.organizationsAPIService
      .retrieveOrganizationEnvironments(orgSlug)
      .pipe(
        tap((environments) => {
          this.setState({ organizationEnvironments: environments });
        })
      );
  }

  private updateErrorMessage(err: HttpErrorResponse): string[] {
    if (err.error) {
      const errorValues: string[][] = Object.values<string[]>(err.error);
      return errorValues.reduce((a, v) => a.concat(v), []);
    } else {
      return [err.message];
    }
  }
}

import { Injectable } from "@angular/core";
import { HttpClient } from "@angular/common/http";
import { StatefulService } from "../shared/stateful-service/stateful-service";
import { AuthService } from "../api/auth/auth.service";
import { catchError, map, tap } from "rxjs/operators";
import { ServerError } from "../shared/django.interfaces";
import { EMPTY } from "rxjs";

const baseUrl = "/rest-auth";

type ValidAuth = "TOTP" | "FIDO2";

interface LoginResponse {
  requires_mfa: boolean;
  valid_auth: ValidAuth[];
}

interface LoginState {
  loading: boolean;
  error: ServerError | null;
  validAuth: ValidAuth[] | null;
}

const initialState: LoginState = {
  loading: false,
  error: null,
  validAuth: null,
};

@Injectable({
  providedIn: "root",
})
export class LoginService extends StatefulService<LoginState> {
  loading$ = this.getState$.pipe(map((state) => state.loading));
  error$ = this.getState$.pipe(map((state) => state.error));
  requiresMFA$ = this.getState$.pipe(map((state) => !!state.validAuth));
  hasFIDO2$ = this.getState$.pipe(
    map((state) => state.validAuth?.includes("FIDO2"))
  );
  hasTOTP$ = this.getState$.pipe(
    map((state) => state.validAuth?.includes("TOTP"))
  );
  constructor(private http: HttpClient, private authService: AuthService) {
    super(initialState);
  }

  login(email: string, password: string) {
    const url = baseUrl + "/login/";
    const data = {
      email,
      password,
    };
    this.setState({ loading: true, error: null });
    return this.http.post<LoginResponse>(url, data).pipe(
      tap((resp) => {
        if (resp.requires_mfa) {
          this.setState({ validAuth: resp.valid_auth });
        } else {
          this.authService.afterLogin();
        }
      }),
      catchError((err) => {
        let error: ServerError | null = null;
        if (err.status === 400) {
          error = err.error;
        } else {
          error = { non_field_errors: ["Error"] };
        }
        this.setState({ loading: false, error });
        return EMPTY;
      })
    );
  }

  authenticateTOTP(code: string) {
    const url = "/api/mfa/authenticate/totp/";
    const data = {
      otp: code,
    };
    this.setState({ loading: true, error: null });
    return this.http.post(url, data).pipe(
      tap(() => {
        this.clearState();
        this.authService.afterLogin();
      }),
      catchError((err) => {
        let error: ServerError | null = null;
        if (err.status === 400) {
          error = { non_field_errors: err.error };
        } else {
          error = { non_field_errors: ["Error"] };
        }
        this.setState({ loading: false, error });
        return EMPTY;
      })
    );
  }

  authenticateBackupCode(code: string) {
    const url = "/api/mfa/authenticate/backup_codes/";
    const data = {
      code: code,
    };
    this.setState({ loading: true, error: null });
    return this.http.post(url, data).pipe(
      tap(() => {
        this.clearState();
        this.authService.afterLogin();
      }),
      catchError((err) => {
        let error: ServerError | null = null;
        if (err.status === 400) {
          if (err.error.code) {
            error = err.error;
            console.log(error);
          } else {
            error = { non_field_errors: err.error };
          }
        } else {
          error = { non_field_errors: ["Error"] };
        }
        this.setState({ loading: false, error });
        return EMPTY;
      })
    );
  }
}

import { Injectable } from "@angular/core";
import { Router } from "@angular/router";
import { BehaviorSubject, fromEvent } from "rxjs";
import { debounceTime, map, tap } from "rxjs/operators";

interface MainNavState {
  navOpen: boolean;
  mobileNav: boolean | null;
}

const initialState: MainNavState = {
  navOpen: true,
  mobileNav: null,
};

@Injectable({
  providedIn: "root",
})
export class MainNavService {
  private readonly state = new BehaviorSubject<MainNavState>(initialState);
  private readonly getState$ = this.state.asObservable();

  readonly navOpen$ = this.getState$.pipe(map((state) => state.navOpen));
  readonly mobileNav$ = this.getState$.pipe(map((state) => state.mobileNav));

  constructor(private router: Router) {
    const tabletSize = 768; // same as $tablet for scss

    if (window.innerWidth < tabletSize) {
      this.mobileNavSettings();
    } else {
      this.desktopNavSettings();
    }

    this.router.events.subscribe((_) => {
      if (window.innerWidth < tabletSize) {
        this.setCloseNav();
      }
    });

    fromEvent(window, "resize")
      .pipe(
        debounceTime(100),
        tap((_) => {
          if (window.innerWidth < tabletSize) {
            this.mobileNavSettings();
          } else {
            this.desktopNavSettings();
          }
        })
      )
      .subscribe();
  }

  mobileNavSettings() {
    this.setMobileNav(true);
    this.setCloseNav();
  }

  desktopNavSettings() {
    this.setMobileNav(false);
    this.setOpenNav();
  }

  getToggleNav() {
    this.setToggleNav();
  }

  getClosedNav() {
    this.setCloseNav();
  }

  private setMobileNav(isMobile: boolean) {
    this.state.next({
      ...this.state.getValue(),
      mobileNav: isMobile,
    });
  }

  private setCloseNav() {
    this.state.next({
      ...this.state.getValue(),
      navOpen: false,
    });
  }

  private setOpenNav() {
    this.state.next({
      ...this.state.getValue(),
      navOpen: true,
    });
  }

  private setToggleNav() {
    const navOpen = this.state.getValue().navOpen;
    this.state.next({
      ...this.state.getValue(),
      navOpen: !navOpen,
    });
  }
}

import { Injectable } from "@angular/core";
import { HttpErrorResponse, HttpClient } from "@angular/common/http";
import { MatSnackBar } from "@angular/material/snack-bar";
import { BehaviorSubject, combineLatest, EMPTY } from "rxjs";
import { map, take, exhaustMap, tap, catchError } from "rxjs/operators";
import { Member } from "./organizations.interface";
import { OrganizationsService } from "./organizations.service";
import { baseUrl } from "src/app/constants";

interface MemberDetailState {
  memberDetail: Member | null;
  updateMemberError: string;
  updateMemberLoading: boolean;
}

const initialState: MemberDetailState = {
  memberDetail: null,
  updateMemberError: "",
  updateMemberLoading: false,
};

@Injectable({ providedIn: "root" })
export class MemberDetailService {
  private readonly url = baseUrl + "/organizations/";
  private readonly state = new BehaviorSubject<MemberDetailState>(initialState);
  private readonly getState$ = this.state.asObservable();
  readonly memberDetail$ = this.getState$.pipe(
    map((data) => data.memberDetail)
  );
  readonly updateMemberError$ = this.getState$.pipe(
    map((state) => state.updateMemberError)
  );
  readonly updateMemberLoading$ = this.getState$.pipe(
    map((state) => state.updateMemberLoading)
  );

  constructor(
    private organizationsService: OrganizationsService,
    private http: HttpClient,
    private snackBar: MatSnackBar
  ) {}

  /** Update member teams and/or permissions */
  updateMember(updatedRole: string) {
    this.setUpdateMemberLoading(true);
    return combineLatest([
      this.organizationsService.activeOrganizationSlug$,
      this.memberDetail$,
    ])
      .pipe(
        take(1),
        exhaustMap(([orgSlug, memberDetail]) => {
          const data = {
            ...memberDetail,
            role: updatedRole,
          };
          const url = `${this.url}${orgSlug}/members/${memberDetail?.id}/`;
          return this.http.put<Member>(url, data).pipe(
            tap((resp) => {
              this.setUpdateMemberLoading(false);
              this.snackBar.open(
                `Successfully updated ${resp.email}'s role to ${resp.roleName}`
              );
              if (memberDetail) {
                const newMemberDetail = { ...resp, teams: memberDetail.teams };
                this.updateMemberDetail(newMemberDetail);
              }
            }),
            catchError((error: HttpErrorResponse) => {
              this.setUpdateMemberLoading(false);
              this.setUpdateMemberError(`${error.statusText}: ${error.status}`);
              return EMPTY;
            })
          );
        })
      )
      .toPromise();
  }

  clearState() {
    this.state.next(initialState);
  }

  retrieveMemberDetail(orgSlug: string, memberId: string) {
    const url = `${this.url}${orgSlug}/members/${memberId}/`;
    return this.http
      .get<Member>(url)
      .pipe(tap((memberDetail) => this.setMemberDetail(memberDetail)));
  }

  updateMemberDetail(member: Member) {
    this.setMemberDetail(member);
  }

  private setUpdateMemberError(errorMessage: string) {
    this.state.next({
      ...this.state.getValue(),
      updateMemberError: errorMessage,
    });
  }

  private setUpdateMemberLoading(loading: boolean) {
    this.state.next({ ...this.state.getValue(), updateMemberLoading: loading });
  }

  private setMemberDetail(member: Member) {
    this.state.next({
      ...this.state.getValue(),
      memberDetail: member,
    });
  }
}

