import { Injectable } from "@angular/core";
import { HttpClient } from "@angular/common/http";
import { MatSnackBar } from "@angular/material/snack-bar";
import { BehaviorSubject, EMPTY, combineLatest, Observable } from "rxjs";
import {
  mergeMap,
  map,
  tap,
  catchError,
  exhaustMap,
  take,
} from "rxjs/operators";
import { OrganizationsService } from "./organizations.service";
import { baseUrl } from "../../constants";
import { Member, MemberSelector } from "./organizations.interface";
import { UserService } from "../user/user.service";

interface MembersState {
  loadingResendInvite: number | null;
  sentResendInvite: number[];
}

const initialState: MembersState = {
  loadingResendInvite: null,
  sentResendInvite: [],
};

@Injectable({ providedIn: "root" })
export class MembersService {
  private readonly url = baseUrl + "/organizations/";
  private readonly state = new BehaviorSubject<MembersState>(initialState);
  private readonly getState$ = this.state.asObservable();
  readonly loadingResendInvite$ = this.getState$.pipe(
    map((state) => state.loadingResendInvite)
  );
  readonly sentResendInvite$ = this.getState$.pipe(
    map((state) => state.sentResendInvite)
  );
  /** Organization members with computed loading/success data */
  readonly members$: Observable<MemberSelector[]> = combineLatest([
    this.organizationsService.organizationMembers$,
    this.loadingResendInvite$,
    this.sentResendInvite$,
    this.userService.activeUserEmail$,
  ]).pipe(
    map(([members, loadingResendInvite, sentResendInvite, activeUserEmail]) => {
      return members.map((member) => {
        return {
          ...member,
          loadingResendInvite: member.id === loadingResendInvite ? true : false,
          sentResendInvite: sentResendInvite.includes(member.id) ? true : false,
          isMe: member.email === activeUserEmail ? true : false,
        };
      });
    })
  );

  constructor(
    private organizationsService: OrganizationsService,
    private userService: UserService,
    private http: HttpClient,
    private snackBar: MatSnackBar
  ) {}

  /** Send another invite to already invited org member */
  resendInvite(memberId: number) {
    const data = { reinvite: 1 };
    this.setLoadingResendInvite(memberId);
    return this.organizationsService.activeOrganizationSlug$
      .pipe(
        take(1),
        mergeMap((orgSlug) =>
          this.http.put(`${this.url}${orgSlug}/members/${memberId}/`, data)
        ),
        tap(() => this.setResendInviteSuccess(memberId)),
        catchError(() => {
          this.clearLoadingResendInvite();
          return EMPTY;
        })
      )
      .toPromise();
  }

  /** Remove member for active organization. */
  removeMember(member: Member) {
    return this.organizationsService.activeOrganizationSlug$
      .pipe(
        take(1),
        exhaustMap((orgSlug) => {
          return this.http
            .delete(`${this.url}${orgSlug}/members/${member.id}/`)
            .pipe(
              exhaustMap(() => {
                this.snackBar.open(
                  `Successfully removed ${member.email} from organization`
                );
                if (orgSlug) {
                  return this.organizationsService.retrieveOrganizationMembers(
                    orgSlug
                  );
                }
                return EMPTY;
              }),
              catchError(() => {
                this.snackBar.open(
                  `Error attempting to remove ${member.email} from organization`
                );
                return EMPTY;
              })
            );
        })
      )
      .toPromise();
  }

  private setLoadingResendInvite(memberId: number) {
    this.state.next({
      ...this.state.getValue(),
      loadingResendInvite: memberId,
    });
  }

  private setResendInviteSuccess(memberId: number) {
    const state = this.state.getValue();
    this.state.next({
      ...state,
      loadingResendInvite: null,
      sentResendInvite: [...state.sentResendInvite, memberId],
    });
  }

  private clearLoadingResendInvite() {
    this.state.next({ ...this.state.getValue(), loadingResendInvite: null });
  }
}

import { HttpErrorResponse } from "@angular/common/http";
import { Injectable } from "@angular/core";
import { EMPTY } from "rxjs";
import { catchError, exhaustMap, map, tap } from "rxjs/operators";
import {
  BackupCodes,
  TOTPResponse,
  UserKey,
  UserKeysService,
} from "src/app/api/mfa/user-keys.service";
import { ServerError } from "src/app/shared/django.interfaces";
import { StatefulService } from "src/app/shared/stateful-service/stateful-service";

interface MFAState {
  userKeys: UserKey[];
  initialLoad: boolean;
  setupTOTPStage: number;
  TOTPResponse: TOTPResponse | null;
  serverError: ServerError;
  backupCodes: BackupCodes | null;
  copiedCodes: boolean;
  /** User has successfully entered one of the backup codes, confirming they have them */
  enteredCode: boolean;
}

const initialState: MFAState = {
  userKeys: [],
  initialLoad: false,
  setupTOTPStage: 1,
  TOTPResponse: null,
  serverError: {},
  backupCodes: null,
  copiedCodes: false,
  enteredCode: false,
};

@Injectable({
  providedIn: "root",
})
export class MultiFactorAuthService extends StatefulService<MFAState> {
  initialLoad$ = this.getState$.pipe(map((state) => state.initialLoad));
  userKeys$ = this.getState$.pipe(map((state) => state.userKeys));
  TOTPKey$ = this.userKeys$.pipe(
    map((userKeys) => userKeys.find((key) => key.key_type === "TOTP"))
  );
  FIDO2Keys$ = this.userKeys$.pipe(
    map((keys) => keys.filter((key) => key.key_type === "FIDO2"))
  );
  setupTOTPStage$ = this.getState$.pipe(map((state) => state.setupTOTPStage));
  totp$ = this.getState$.pipe(map((state) => state.TOTPResponse));
  serverError$ = this.getState$.pipe(map((state) => state.serverError));
  backupCodes$ = this.getState$.pipe(map((state) => state.backupCodes));
  copiedCodes$ = this.getState$.pipe(
    map((state) => state.backupCodes !== null && state.copiedCodes)
  );
  enteredCodeSuccess$ = this.getState$.pipe(
    map((state) => state.copiedCodes && state.enteredCode)
  );

  constructor(private api: UserKeysService) {
    super(initialState);
  }

  getUserKeys() {
    return this.api
      .list()
      .pipe(tap((userKeys) => this.setState({ userKeys, initialLoad: true })));
  }

  deleteKey(keyId: number) {
    return this.api
      .destroy(keyId.toString())
      .pipe(exhaustMap(() => this.getUserKeys()));
  }

  incrementTOTPStage() {
    const setupTOTPStage = this.state.getValue().setupTOTPStage;
    if (setupTOTPStage === 1) {
      this.getTOTP().subscribe();
      this.getBackupCodes().subscribe();
    }
    this.setState({ setupTOTPStage: setupTOTPStage + 1 });
  }

  decrementTOTPStage() {
    const setupTOTPStage = this.state.getValue().setupTOTPStage;
    this.setState({ setupTOTPStage: setupTOTPStage - 1 });
  }

  enableTOTP(code: string) {
    const state = this.state.getValue();
    this.setState({ serverError: {} });
    if (state.TOTPResponse) {
      return this.api
        .totpCreate({
          answer: code,
          secret_key: state.TOTPResponse.secret_key,
        })
        .pipe(
          tap(() => {
            this.clearState();
            this.getUserKeys().subscribe();
          }),
          catchError((err) => {
            if (err instanceof HttpErrorResponse) {
              if (err.error) {
                this.setState({ serverError: err.error });
              }
            }
            return EMPTY;
          })
        );
    }
    return EMPTY;
  }

  getTOTP() {
    return this.api
      .totp()
      .pipe(tap((resp) => this.setState({ TOTPResponse: resp })));
  }

  getBackupCodes() {
    return this.api.backupCodes().pipe(
      tap((resp) =>
        this.setState({
          backupCodes: resp.codes,
          copiedCodes: false,
          enteredCode: false,
        })
      )
    );
  }

  setCopiedCodes() {
    this.setState({ copiedCodes: true });
  }

  verifyBackupCode(code: string) {
    const state = this.state.getValue();
    if (state.backupCodes !== null && state.backupCodes.includes(code)) {
      return this.api
        .backupCodesCreate({
          name: "Backup Codes",
          codes: state.backupCodes,
        })
        .pipe(
          tap(() =>
            this.setState({
              setupTOTPStage: state.setupTOTPStage + 1,
              backupCodes: null,
              serverError: {},
            })
          )
        );
    } else {
      this.setState({ serverError: { non_field_errors: ["Invalid code"] } });
    }
    return EMPTY;
  }
}

import { Injectable } from "@angular/core";
import { BehaviorSubject, EMPTY, combineLatest } from "rxjs";
import { map, tap, catchError } from "rxjs/operators";
import { baseUrl } from "src/app/constants";
import { HttpClient } from "@angular/common/http";
import { ProjectsService } from "src/app/projects/projects.service";
import { HttpErrorResponse } from "@angular/common/http";
import {
  GroupedProjects,
  ProjectError,
  ProjectWithAlertStatus,
  NotificationStatus,
  ProjectAlerts,
  SubscribeByDefault,
} from "./notifications.interface";

interface NotificationsState {
  projectViewExpanded: boolean;
  subscribeByDefault: boolean;
  subscribeByDefaultLoading: boolean;
  subscribeByDefaultError: string;
  groupedProjects: GroupedProjects;
  projectAlertLoading: string;
  projectAlertError: ProjectError;
}

const initialState: NotificationsState = {
  projectViewExpanded: false,
  subscribeByDefault: true,
  subscribeByDefaultLoading: false,
  subscribeByDefaultError: "",
  groupedProjects: [],
  projectAlertLoading: "",
  projectAlertError: { error: "", id: "" },
};

@Injectable({
  providedIn: "root",
})
export class NotificationsService {
  private readonly notificationsState = new BehaviorSubject<NotificationsState>(
    initialState
  );
  private readonly getState$ = this.notificationsState.asObservable();
  private readonly url = `${baseUrl}/users/me/notifications/`;
  readonly subscribeByDefault$ = this.getState$.pipe(
    map((data) => data.subscribeByDefault)
  );
  readonly projectViewExpanded$ = this.getState$.pipe(
    map((data) => data.projectViewExpanded)
  );
  readonly subscribeByDefaultLoading$ = this.getState$.pipe(
    map((data) => data.subscribeByDefaultLoading)
  );
  readonly subscribeByDefaultError$ = this.getState$.pipe(
    map((data) => data.subscribeByDefaultError)
  );
  readonly groupedProjects$ = this.getState$.pipe(
    map((data) => data.groupedProjects)
  );
  readonly projectAlertLoading$ = this.getState$.pipe(
    map((data) => data.projectAlertLoading)
  );
  readonly projectAlertsError$ = this.getState$.pipe(
    map((data) => data.projectAlertError)
  );

  constructor(
    private projectsService: ProjectsService,
    private http: HttpClient
  ) {}

  subscribeToEndpoints() {
    this.notificationsList();
    this.retrieveUserAlertSettings();
    this.projectsService.retrieveProjects();
  }

  notificationsList() {
    return this.http
      .get<SubscribeByDefault>(this.url)
      .pipe(tap((resp) => this.setSubscribeByDefault(resp.subscribeByDefault)))
      .toPromise();
  }

  alertsList() {
    return this.http.get<ProjectAlerts>(`${this.url}alerts/`);
  }

  retrieveUserAlertSettings() {
    combineLatest([this.alertsList(), this.projectsService.projects$])
      .pipe(
        map(([projectAlerts, projects]) => {
          if (projects) {
            const projectsWithAlerts = projects.map((project) => {
              const matchingId = Object.keys(projectAlerts).find(
                (element) => element === project.id
              );
              return {
                ...project,
                alertStatus: matchingId ? projectAlerts[matchingId] : -1,
              };
            });
            this.groupProjectsByOrg(projectsWithAlerts);
          }
        })
      )
      .subscribe();
  }

  groupProjectsByOrg(projects: ProjectWithAlertStatus[]) {
    const groupedProjects = projects.reduce(
      (r: GroupedProjects, a: ProjectWithAlertStatus) => {
        r[a.organization.id] = [...(r[a.organization.id] || []), a];
        return r;
      },
      {}
    );
    this.setGroupedProjects(groupedProjects);
  }

  alertsUpdate(projectId: string, status: NotificationStatus) {
    const data: ProjectAlerts = {
      [projectId]: status,
    };
    this.setProjectAlertLoading(projectId);
    return this.http
      .put<ProjectAlerts>(`${this.url}alerts/`, data)
      .pipe(
        tap((_) => {
          this.retrieveUserAlertSettings();
          this.setProjectAlertLoading("");
        }),
        catchError((error) => {
          if (error) {
            this.setProjectAlertLoading("");
            this.setProjectAlertError(this.error(error), projectId);
          }
          return EMPTY;
        })
      )
      .toPromise();
  }

  notificationsUpdate(subscribe: boolean) {
    const data = { subscribeByDefault: subscribe };
    this.setSubscribeByDefaultLoading(true);
    return this.http
      .put<SubscribeByDefault>(this.url, data)
      .pipe(
        tap((resp) => {
          this.setSubscribeByDefaultLoading(false);
          this.setSubscribeByDefault(resp.subscribeByDefault);
        }),
        catchError((error) => {
          if (error) {
            this.setSubscribeByDefaultLoading(false);
            this.setSubscribeByDefaultError(this.error(error));
          }
          return EMPTY;
        })
      )
      .subscribe();
  }

  error(error: HttpErrorResponse): string {
    return `${error.name}: ${error.statusText}`;
  }

  toggleProjectView() {
    this.setToggleProjectView();
  }

  private setSubscribeByDefault(subscribe: boolean) {
    this.notificationsState.next({
      ...this.notificationsState.getValue(),
      subscribeByDefault: subscribe,
    });
  }

  private setToggleProjectView() {
    const projectViewExpanded = this.notificationsState.getValue()
      .projectViewExpanded;
    this.notificationsState.next({
      ...this.notificationsState.getValue(),
      projectViewExpanded: !projectViewExpanded,
    });
  }

  private setSubscribeByDefaultError(error: string) {
    this.notificationsState.next({
      ...this.notificationsState.getValue(),
      subscribeByDefaultError: error,
    });
  }

  private setSubscribeByDefaultLoading(loading: boolean) {
    this.notificationsState.next({
      ...this.notificationsState.getValue(),
      subscribeByDefaultLoading: loading,
    });
  }

  private setProjectAlertLoading(projectId: string) {
    this.notificationsState.next({
      ...this.notificationsState.getValue(),
      projectAlertLoading: projectId,
    });
  }

  private setProjectAlertError(error: string, id: string) {
    this.notificationsState.next({
      ...this.notificationsState.getValue(),
      projectAlertError: { error, id },
    });
  }

  private setGroupedProjects(projects: GroupedProjects) {
    this.notificationsState.next({
      ...this.notificationsState.getValue(),
      groupedProjects: projects,
    });
  }
}

