import { Injectable } from "@angular/core";
import { HttpClient, HttpParams } from "@angular/common/http";
import { tap, catchError, map } from "rxjs/operators";
import { EMPTY } from "rxjs";
import { baseUrl } from "../../constants";
import { UserReport } from "./user-reports.interfaces";
import {
  initialPaginationState,
  PaginationStatefulService,
  PaginationStatefulServiceState,
} from "src/app/shared/stateful-service/pagination-stateful-service";

export interface UserReportsState extends PaginationStatefulServiceState {
  reports: UserReport[] | null;
  errors: string | null;
}

const initialState: UserReportsState = {
  reports: null,
  errors: null,
  pagination: initialPaginationState,
};

@Injectable({
  providedIn: "root",
})
export class UserReportsService extends PaginationStatefulService<UserReportsState> {
  private readonly issuePageUrl = baseUrl + "/issues/";

  reports$ = this.getState$.pipe(map((state) => state.reports));
  errors$ = this.getState$.pipe(map((state) => state.errors));

  constructor(private http: HttpClient) {
    super(initialState);
  }

  getReportsForIssue(issue: number, cursor: string | undefined) {
    this.setLoadingReports(true);
    this.resetUserReports();
    this.getIssueReports(issue, cursor)
      .pipe(
        tap((response) => {
          this.setLoadingReports(false);
          this.resetErrorsReports();
          if (response.body) {
            this.setStateAndPagination({ reports: response.body }, response);
          }
        }),
        catchError((error) => {
          this.setLoadingReports(false);
          this.setErrorsReports(
            "Something went wrong. Try reloading the page."
          );
          return EMPTY;
        })
      )
      .subscribe();
  }

  private getIssueReports(issueId: number, cursor: string | undefined) {
    let httpParams = new HttpParams();
    if (cursor) {
      httpParams = httpParams.set("cursor", cursor);
    }
    return this.http.get<UserReport[]>(
      `${this.issuePageUrl}${issueId}/user-reports/`,
      { observe: "response", params: httpParams }
    );
  }

  private setLoadingReports(loading: boolean) {
    const state = this.state.getValue();
    this.setState({
      pagination: {
        ...state.pagination,
        loading,
      },
    });
  }

  private setErrorsReports(message: string) {
    this.setState({ errors: message });
  }

  private resetUserReports() {
    this.setState({ reports: initialState.reports });
  }

  private resetErrorsReports() {
    this.setState({ errors: initialState.errors });
  }
}

import { Injectable } from "@angular/core";
import { HttpClient, HttpErrorResponse } from "@angular/common/http";
import { MatSnackBar } from "@angular/material/snack-bar";
import { BehaviorSubject, EMPTY, Subject } from "rxjs";
import { tap, map, catchError, exhaustMap } from "rxjs/operators";
import { User } from "./user.interfaces";

interface UserState {
  user: User | null;
  disconnectLoading: number | null;
}

const initialState: UserState = {
  user: null,
  disconnectLoading: null,
};

@Injectable({
  providedIn: "root",
})
export class UserService {
  private readonly state = new BehaviorSubject<UserState>(initialState);
  readonly userDetails$ = this.state.pipe(map((state) => state.user));
  readonly disconnectLoading$ = this.state.pipe(
    map((state) => state.disconnectLoading)
  );
  private readonly getUserDetailsAction = new Subject();

  readonly activeUserEmail$ = this.userDetails$.pipe(
    map((userDetails) => userDetails?.email)
  );
  private readonly url = "/api/0/users/me/";

  constructor(private http: HttpClient, private snackBar: MatSnackBar) {
    this.getUserDetailsAction
      .pipe(
        exhaustMap(() =>
          this.retrieveUserDetails().pipe(
            tap((resp: User) => this.setUserDetails(resp)),
            tap((resp: User) => this.matomoSetUserId(resp.id)),
            catchError(() => EMPTY)
          )
        )
      )
      .subscribe();
  }

  /**
   * If Matomo is present, set user ID.
   * app.glitchtip.com will further anonymize this and respects Do Not Track
   */
  matomoSetUserId(id: string) {
    // tslint:disable:no-any
    const _paq: any = (window as any)._paq;
    _paq.push(["setUserId", id]);
  }

  /** Get and set current logged in user details from backend */
  getUserDetails() {
    this.getUserDetailsAction.next();
  }

  private retrieveUserDetails() {
    return this.http.get<User>(this.url);
  }

  disconnectSocialAccount(accountId: number) {
    this.setDisconnectLoading(accountId);
    this.http
      .post("/api/socialaccounts/" + accountId + "/disconnect/", {})
      .pipe(
        tap(() => {
          this.setDisconnectLoading(null);
          this.getUserDetails();
          this.snackBar.open(
            "You have successfully disconnected your social auth account"
          );
        }),
        catchError((err: HttpErrorResponse) => {
          this.setDisconnectLoading(null);
          if (Array.isArray(err.error) && err.error.length) {
            this.snackBar.open(err.error[0]);
          }
          return EMPTY;
        })
      )
      .toPromise();
  }

  private setDisconnectLoading(loading: number | null) {
    this.state.next({ ...this.state.getValue(), disconnectLoading: loading });
  }

  private setUserDetails(userDetails: User) {
    this.state.next({ ...this.state.getValue(), user: userDetails });
  }
}

