import { Component, OnInit } from "@angular/core";
import { Router, RoutesRecognized, NavigationEnd } from "@angular/router";
import { map, filter, take, exhaustMap, tap } from "rxjs/operators";
import { combineLatest } from "rxjs";
import { AuthService } from "./api/auth/auth.service";
import { OrganizationsService } from "./api/organizations/organizations.service";
import { SettingsService } from "./api/settings.service";
import { UserService } from "./api/user/user.service";
import { Title } from "@angular/platform-browser";

@Component({
  selector: "gt-root",
  templateUrl: "./app.component.html",
})
export class AppComponent implements OnInit {
  title = "glitchtip-frontend";
  isLoggedIn$ = this.auth.isLoggedIn;

  /**
   * Need RoutesRecognized to fire before retrieving organizations since doing
   * so relies on the organization slug to set the active org
   */
  routesAreRecognized$ = this.router.events.pipe(
    map((event) => {
      if (event instanceof RoutesRecognized) {
        return true;
      }
      return false;
    }),
    filter((isRecognized) => !!isRecognized),
    take(1)
  );

  constructor(
    private auth: AuthService,
    private userService: UserService,
    private organizationService: OrganizationsService,
    private settings: SettingsService,
    private router: Router,
    private titleService: Title
  ) {}

  ngOnInit() {
    this.settings.getSettings().subscribe();

    this.router.events.subscribe((event) => {
      if (event instanceof NavigationEnd) {
        // tslint:disable:no-any
        const _paq: any = (window as any)._paq;
        if (_paq) {
          const origin = location.origin;
          _paq.push(["setCustomUrl", origin + event.url]);
          _paq.push(["trackPageView"]);
        }
      }

      if (event instanceof RoutesRecognized && event.state.root.firstChild) {
        const params = event.state.root.firstChild.params;
        const orgSlug = params["org-slug"];
        if (orgSlug !== undefined) {
          this.organizationService.setActiveOrganizationFromRouteChange(
            orgSlug
          );
        }
      }

      if (event instanceof RoutesRecognized) {
        let titleTag = "GlitchTip";
        if (typeof event.state.root.firstChild!.data.title !== "undefined") {
          titleTag = event.state.root.firstChild!.data.title + " | GlitchTip";
        }
        this.titleService.setTitle(titleTag);
      }
    });

    combineLatest([this.isLoggedIn$, this.routesAreRecognized$])
      .pipe(
        filter(([isLoggedIn, _]) => !!isLoggedIn),
        exhaustMap(() => this.organizationService.retrieveOrganizations()),
        tap(() => this.userService.getUserDetails())
      )
      .subscribe();
  }
}

import { Component, OnInit, ChangeDetectionStrategy } from "@angular/core";
import { ActivatedRoute, Router, ParamMap } from "@angular/router";
import { HttpErrorResponse } from "@angular/common/http";
import { EMPTY } from "rxjs";
import { map, catchError, tap } from "rxjs/operators";
import { GlitchTipOAuthService } from "../api/oauth/oauth.service";
import { AuthService } from "../api/auth/auth.service";
import { MatSnackBar } from "@angular/material/snack-bar";

@Component({
  selector: "gt-auth",
  templateUrl: "./auth.component.html",
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class AuthComponent implements OnInit {
  provider$ = this.route.params.pipe(map((params) => params.provider));
  isLoggedIn = false;

  constructor(
    private route: ActivatedRoute,
    private router: Router,
    private oauthService: GlitchTipOAuthService,
    private authService: AuthService,
    private snackbar: MatSnackBar
  ) {
    authService.isLoggedIn.subscribe(
      (isLoggedIn) => (this.isLoggedIn = isLoggedIn)
    );
  }

  ngOnInit(): void {
    const provider: string | undefined = this.route.snapshot.params.provider;
    const fragment = this.route.snapshot.fragment!;
    const query = this.route.snapshot.queryParamMap;
    if (provider) {
      this.attemptOAuthLogin(provider, fragment, query);
    } else {
      this.notEnoughQueryData();
    }
  }

  private attemptOAuthLogin(
    provider: string,
    fragment: string,
    query: ParamMap
  ) {
    // Various services return tokens in slightly different ways
    if (fragment) {
      const accessToken = new URLSearchParams(fragment).get("access_token");
      if (accessToken) {
        if (provider === "gitlab") {
          this.oauthService
            .gitlabLogin(accessToken, this.isLoggedIn)
            .pipe(
              tap(() => this.loginSuccess()),
              catchError((error: HttpErrorResponse) => {
                this.processSocialAuthErrorResponse(error);
                return EMPTY;
              })
            )
            .toPromise();
        } else if (provider === "google") {
          this.oauthService
            .googleLogin(accessToken, this.isLoggedIn)
            .pipe(
              tap(() => this.loginSuccess()),
              catchError((error: HttpErrorResponse) => {
                this.processSocialAuthErrorResponse(error);
                return EMPTY;
              })
            )
            .toPromise();
        } else if (provider === "microsoft") {
          this.oauthService
            .microsoftLogin(accessToken, this.isLoggedIn)
            .pipe(
              tap(() => this.loginSuccess()),
              catchError((error: HttpErrorResponse) => {
                this.processSocialAuthErrorResponse(error);
                return EMPTY;
              })
            )
            .toPromise();
        }
      }
    } else if (query) {
      const code = query.get("code");
      if (code) {
        if (provider === "github") {
          this.oauthService
            .githubLogin(code, this.isLoggedIn)
            .pipe(
              tap(() => this.loginSuccess()),
              catchError((error: HttpErrorResponse) => {
                this.processSocialAuthErrorResponse(error);
                return EMPTY;
              })
            )
            .toPromise();
        }
      }
    } else {
      this.notEnoughQueryData();
    }
  }

  private processSocialAuthErrorResponse(error: HttpErrorResponse) {
    if (error.status === 400) {
      if (error.error?.non_field_errors) {
        this.router.navigate([""]);
        this.snackbar.open(error.error.non_field_errors[0]);
      }
    } else if (error.status === 500) {
      this.router.navigate([""]);
      this.snackbar.open(
        "There was an error connecting to your social authentication provider."
      );
    }
  }

  /** Not enough data to even try auth...just navigate home */
  private notEnoughQueryData() {
    this.router.navigate([]);
  }

